import React from 'react';

const PixelGrid = () => {
  // Create an array of 128 * 64 = 8192 pixels
  const pixels = Array(8192).fill(null);

  return (
    <div className="pixel-grid">
      {pixels.map((_, index) => (
        <div key={index} className="pixel" />
      ))}
    </div>
  );
};

export default PixelGrid;
